import React from 'react';

function RoundedTextBox(props) {
  return (
    <div>
      <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
        <p>Hello</p>
        <input
          type="text"
          style={{
            borderRadius: '5px',
            padding: '10px',
            border: '1px solid gray',
          }}
          {...props}
        />
      </div>
    </div>
  );
}

export default RoundedTextBox;
